import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the "Your Profile" link (first visible occurrence)
    const profileLink = await page.waitForSelector('a:text("Your Profile")', { timeout: 5000 });
    await profileLink.click();

    // Wait for the profile page to load (look for .profile-page)
    await page.waitForSelector('.profile-page', { timeout: 5000 });

    // Screenshot of profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract profile information
    const extractedData = await page.evaluate(() => {
      const profileHeader = document.querySelector('.profile-header');
      if (!profileHeader) return {};

      const fullName = profileHeader.querySelector('.profile-info h2')?.innerText || '';
      const username = profileHeader.querySelector('.profile-info .username')?.innerText || '';
      const bio = profileHeader.querySelector('.profile-info .bio')?.innerText || '';
      const profileImage = profileHeader.querySelector('.profile-image')?.getAttribute('src') || '';

      // Profile stats
      const stats = profileHeader.querySelectorAll('.profile-stats .stat');
      let totalOrders = '', totalReviews = '', sellerRating = '';
      if (stats.length >= 3) {
        totalOrders = stats[0].querySelector('.stat-number')?.innerText || '';
        totalReviews = stats[1].querySelector('.stat-number')?.innerText || '';
        sellerRating = stats[2].querySelector('.stat-number')?.innerText || '';
      }

      // Recent reviews
      const reviewNodes = Array.from(document.querySelectorAll('.reviews-list .review-item'));
      const recentReviews = reviewNodes.slice(0, 3).map(review => {
        const productTitle = review.querySelector('.review-product-title')?.innerText || '';
        const rating = review.querySelector('.stars')?.innerText || '';
        const reviewTitle = review.querySelector('.review-title')?.innerText || '';
        const content = review.querySelector('.review-content')?.innerText || '';
        const date = review.querySelector('.review-date')?.innerText || '';
        return { productTitle, rating, reviewTitle, content, date };
      });

      // Jun's products
      const productCards = Array.from(document.querySelectorAll('.profile-sections .section .products-grid .product-card'));
      const products = productCards.map(card => {
        const title = card.querySelector('.product-title')?.innerText || '';
        const price = card.querySelector('.product-price')?.innerText || '';
        const seller = card.querySelector('.seller-info')?.innerText || '';
        return { title, price, seller };
      });

      return {
        fullName,
        username,
        bio,
        profileImage,
        totalOrders,
        totalReviews,
        sellerRating,
        products,
        recentReviews
      };
    });

    // Screenshot of profile stats section
    const profileStats = await page.$('.profile-header');
    if (profileStats) {
      await profileStats.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_stats.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_profile_stats.png'));
    }

    return {
      success: true,
      action: "Harvested user profile information from the profile page",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
